import styled from "styled-components"

const Wrapper = styled.div`
margin: 0;
padding: 0;
`

function App() {
  return (
    <Wrapper>
      <header className="App-header">
        <h2>hello Home</h2>
      </header>
    </Wrapper>
  );
}

export default App;
